<script>
(function(){
  const attackIntensities = [0, 300, 600, 900, 1200, 1500, 1800, 2100, 2400, 2700, 3000];
  const cpuPerFlowGrid = [0.0, 2000.0, 5000.0, 10000.0];
  const bwPerFlowGrid = [0.0, 0.5, 1.0, 1.5, 2.0];

  const n_ids = 5;
  const n_int = 11;
  const n_cpu = 4;
  const n_bw = 5;

  function traceIndex(i_int, i_cpu, i_bw, i_ids){
    return (((i_int * n_cpu + i_cpu) * n_bw + i_bw) * n_ids + i_ids);
  }

  const root = document.body;
  const ctrl = document.createElement('div');
  ctrl.style.maxWidth = '1000px';
  ctrl.style.margin = '10px auto 0 auto';
  ctrl.style.fontFamily = 'sans-serif';

  function makeSelect(label, values, initIdx){
    const wrap = document.createElement('div');
    wrap.style.margin = '6px 0';
    const lab = document.createElement('div');
    lab.textContent = label;
    lab.style.fontSize = '12px';
    const sel = document.createElement('select');
    sel.style.width = '100%';
    sel.style.padding = '6px';
    values.forEach((v, i) => {
      const opt = document.createElement('option');
      opt.value = String(i);
      opt.text = String(v);
      sel.appendChild(opt);
    });
    sel.value = String(initIdx);
    wrap.appendChild(lab);
    wrap.appendChild(sel);
    return [wrap, sel];
  }

  const plotDiv = document.getElementById('plot');

  const [w1, s1] = makeSelect('Attack intensity (flows_per_sec)', attackIntensities, 0);
  const [w2, s2] = makeSelect('Attacker cpu_per_flow (cycle_per_flow)', cpuPerFlowGrid, 0);
  const [w3, s3] = makeSelect('Attacker bw_per_flow', bwPerFlowGrid, 0);

  ctrl.appendChild(w1);
  ctrl.appendChild(w2);
  ctrl.appendChild(w3);

  root.insertBefore(ctrl, plotDiv);

  function updateVis(){
    const i_int = parseInt(s1.value, 10);
    const i_cpu = parseInt(s2.value, 10);
    const i_bw  = parseInt(s3.value, 10);

    const totalTraces = n_int * n_cpu * n_bw * n_ids;
    const vis = new Array(totalTraces).fill(false);
    const base = traceIndex(i_int, i_cpu, i_bw, 0);
    for(let j=0;j<n_ids;j++) vis[base + j] = true;

    Plotly.restyle(plotDiv, {visible: vis});
    Plotly.relayout(plotDiv, {
      title: `QoE vs Requests | atk=${attackIntensities[i_int]} | cpu_pf=${cpuPerFlowGrid[i_cpu]} | bw_pf=${bwPerFlowGrid[i_bw]}`
    });
  }

  s1.addEventListener('change', updateVis);
  s2.addEventListener('change', updateVis);
  s3.addEventListener('change', updateVis);
})();
</script>
